import { FrostError } from "src/common/error";
import { APIResult } from "src/network/api_response";

export class AccountInfo {
    isSignedIn: boolean = false;
    uuid: number = -1;
    id: string = '';
    nick: string = '';
    email: string = '';

    errShowMsg: string = '';
    private frostErrorObj?: FrostError;
    private responseObj?: APIResult;

    constructor(inObj: Record<string, unknown>) {
        if (!inObj.uuid) return;

        this.isSignedIn = true;

        this.uuid = inObj.uuid;
        this.id = inObj.id;
        this.nick = inObj.nick;
        this.email = inObj.email;
    }
}
